The '''small chest''' is found inside [[H.A.M. Store room]] during and after the [[Death to the Dorgeshuun]] quest. The player needs to pick the lock on the door to get to the chests. To open these chests the player needs one of the following keys found by pickpocketing the [[H.A.M. guard]]s down in store room: 
* [[Bronze key (H.A.M.)|Bronze key]] (opens the south-west chest)
* [[Iron key (H.A.M.)|Iron key]] (opens the north-east chest)
* [[Silver key (H.A.M.)|Silver key]] (opens the north-west chest)
* [[Steel key (H.A.M.)|Steel key]] (opens the south-east chest and two chests in the large room to the north)

